var title_f25_8_25734="Oculomotor circuitry";
var content_f25_8_25734=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F62010&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F62010&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    Oculomotor circuitry",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 680px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Internuclear opthalmoplegia (INO) is characterized by slowing and/or limitation of the adducting eye during horizontal saccades and is the result of damage to the MLF within the dorsomedial pontine or midbrain tegmentum, adjacent to the fourth ventricle and cerebral aqueduct, respectively. During horizontal saccades, the PPRF bust cells innervate the abducens nucleus, which contains two distinctive sets of neurons. Axons from the abducens motorneurons innervate the ipsilateral lateral rectus muscle, while the axons of the abducens interneurons cross the midline to become the MLF and subsequently innervate the medial rectus subnucleus of the oculomotor complex (cranial nerve nucleus III).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from Blumenfeld H. Neuroanatomy through Clincal Cases, figure 13.13 p. 549. Sinauer Associates, MA 2002.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
