var title_f25_8_25740="Management brain abscess";
var content_f25_8_25740=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F50098&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F50098&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rapid empiric management of brain abscess in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Empiric antibiotics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Immediately begin empiric antibiotics following sterotactic or open biopsy/aspiration to obtain a specimen for Gram stain, culture, and pathology.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        <strong>",
"         The antibiotic regimen is dependent on Gram stain, if available, and the likely source of abscess.",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Origin of abscess",
"       </td>",
"       <td class=\"subtitle2\">",
"        Treatment regimen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oral, otogenic, or sinus source",
"       </td>",
"       <td>",
"        Metronidazole (15 mg/kg IV as a loading dose, followed by 7.5 mg/kg IV every eight hours)",
"        <strong>",
"         PLUS either",
"        </strong>",
"        penicillin G (20 to 24 million units per day IV in six equally divided doses) for a suspected oral focus,",
"        <strong>",
"         or",
"        </strong>",
"        ceftriaxone (2 g IV every 12 hours)",
"        <strong>",
"         or",
"        </strong>",
"        cefotaxime (2 g IV every four to six hours) for a suspected sinus or otogenic source",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hematogenous spread",
"       </td>",
"       <td>",
"        <p>",
"         Vancomycin* (30 mg/kg IV daily in two equally divided doses adjusted per renal function) for empiric coverage of methicillin-resistant Staphylococcus aureus",
"        </p>",
"        <p>",
"         Metronidazole may be added for anaerobic coverage",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Postoperative neurosurgical patients",
"       </td>",
"       <td>",
"        Vancomycin* (30 mg/kg IV daily in two equally divided doses adjusted per renal function)",
"        <strong>",
"         PLUS either",
"        </strong>",
"        ceftazidime (2 g IV every eight hours)",
"        <strong>",
"         or",
"        </strong>",
"        cefepime (2 g IV every eight hours)",
"        <strong>",
"         or",
"        </strong>",
"        meropenem (1 g IV every eight hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Penetrating trauma",
"       </td>",
"       <td>",
"        Vancomycin* (30 mg/kg IV daily in two equally divided doses adjusted per renal function)",
"        <strong>",
"         PLUS either",
"        </strong>",
"        ceftriaxone (2 g IV every 12 hours)",
"        <strong>",
"         or",
"        </strong>",
"        cefotaxime (2 g IV every four to six hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Glucocorticoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Glucocorticoids should be used when substantial mass effect can be demonstrated on imaging and the mental status is significantly depressed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Dexamethasone is administered at a loading dose of 10 mg IV followed by 4 mg every six hours.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * If susceptibility testing reveals methicillin-sensitive S. aureus, vancomycin should be replaced with nafcillin (2 g IV every four hours)",
"     <strong>",
"      or",
"     </strong>",
"     oxacillin (2 g IV every four hours).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
