" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Long acting beta agonist in EIB",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 438px; height: 246px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of a single dose of the long-acting beta agonist salmeterol versus placebo in exercise induced bronchoconstriction. Salmeterol, but not placebo, protected against a decline in FEV1 with exercise. This effect was seen at both one (left panel) and nine (right panel) hours.",
"    <div class=\"footnotes\">",
"     EIB: exercise induced bronchoconstriction; FEV1: forced expiratory volume in one second.",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Green CP, Price JF, Arch Dis Child 1992; 67:1014.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Inhaled beta-agonists protect against exercise-induced bronchoconstriction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 397px; height: 337px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The degree of exercise-induced bronchoconstriction (as measured by a fall in peak expiratory flow) with placebo, inhaled salbutamol (albuterol), or the long-acting inhaled beta-2 agonist formoterol. Formoterol produced more prolonged protection than salbutamol.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
